shaders.vertex:
attribute vec4 aVertex;
attribute vec2 aTexCoord;
varying vec2 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
// Farbisolations-Fragment-Shader

varying vec2 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

uniform float uLo; // -75, 300, 173
uniform float uHi; // -75, 365, 230

float hue(vec3 rgb)
{
  float maxval = max(rgb.r , max(rgb.g, rgb.b));
  float minval = min(rgb.r, min(rgb.g, rgb.b));
  float delta = maxval - minval;
  float h = 0.0;
  if (delta > 0.0) {
    if (rgb.r == maxval)
      h = 60.0 * (rgb.g - rgb.b) / delta;
    else if (rgb.g == maxval)
      h = 60.0 * (2.0 + (rgb.b - rgb.r) / delta);
    else
      h = 60.0 * (4.0 + (rgb.r - rgb.g) / delta);
  }
   return h;
}

void main(void)
{
    vec3 col = texture2D(uTexture, vTexCoord).rgb;
    float brightness = dot(col, vec3(0.299, 0.587, 0.114));
    float h = hue(col);
    vec3 result = (h > uLo && h < uHi)? col : vec3(brightness);
    gl_FragColor = vec4(result, 1.0);
}
